class Solution(object):
    def searchRange(self, nums, target):
        """
        :type nums: List[int]
        :type target: int
        :rtype: List[int]
        """
        startingPos = -1
        endingPos = -1
        m = len(nums)
        if (m != 0) and (target>=nums[0]) and (target<=nums[m-1]):
            for i in range(m):
                if startingPos == -1:
                    if nums[i] == target:
                        startingPos = i
                        endingPos = i    
                elif nums[i] == target:
                    endingPos = i
                else:     
                    break
        return [startingPos, endingPos]
